import React, { useState, useEffect } from "react";
import NavBar from "./NavBar";
import '../App.css';

export const PropVal = () => {
  const [data, setData] = useState([{}])

  useEffect(() => {
    fetch("/hello").then(
      res => res.json()
    ).then(
      data => {
        setData(data)
        console.log(data)
      }
    )
  }, [])
};
